import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Table } from 'react-bootstrap';


const Tabel = (props) => {

    const data = props.dataDatas;

    return(



        <Table striped bordered hover variant="dark">
  <thead>
    <tr>
      <th>Nama</th>
      <th>Email</th>
    </tr>
  </thead>
  <tbody>
  {data.map(datas => {
                    return(
                        <tr>
                            <td>{datas.Nama}</td>
                            <td>{datas.Email}</td>
                        </tr>
                    );
                })
                }
  </tbody>
</Table>
    );
}
export default Tabel;
